143X)"]},{"cell_type":"markdown","id":"edda92c2","metadata":{"papermill":{"duration":0.009142,"end_time":"2024-01-22T10:35:43.508198","exception":false,"start_time":"2024-01-22T10:35:43.499056","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"3fabd1c6","metadata":{"papermill":{"duration":0.009146,"end_time":"2024-01-22T10:35:43.527498","exception":false,"start_time":"2024-01-22T10:35:43.518352","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"5b117b8d","metadata":{"execution":{"iopub.execute_input":"2024-01-22T10:35:43.550621Z","iopub.status.busy":"2024-01-22T10:35:43.548276Z","iopub.status.idle":"2024-01-22T10:35:43.627017Z","shell.execute_reply":"2024-01-22T10:35:43.624228Z"},"papermill":{"duration":0.093474,"end_time":"2024-01-22T10:35:43.630245","exception":false,"start_time":"2024-01-22T10:35:43.536771","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td